;; **
;;; # Radial Basis Function Neural Network
;;; 
;;; $$ f(x) = 0.5 + 0.4sin(2\pi x) $$
;;; 
;;; $$ F(x) = \sum_{j=0}^M w_j x^j $$
;; **

;; @@
(ns enigmatic-iceberg
  (:require [gorilla-plot.core :as plot]
            [rbf-network.core :as rbf]
            [rbf-network.utils :as utils]
            [clojure.math.combinatorics :as combo]))

(def data (utils/process-data "data.txt"))

(def K '(2 4 7 11 16))

(def E '(0.01 0.02))

(def G (map vec (combo/cartesian-product K E)))

(defn rbf-approx [data start end same-vars? [k e]]
  (let [[clusters U vars weights] (rbf/train data k e start end same-vars?)
       F (partial rbf/F U weights vars false)]
    (plot/compose (plot/list-plot data) (plot/plot utils/h [0 1]) (plot/plot F [0 1] :color "#4CD964"))))
 
(map (partial rbf-approx data 0 1 false) G)

(map (partial rbf-approx data 0 1 true) G)
